import React from 'react';
import { FaBed, FaUserFriends } from 'react-icons/fa';

const PropertyCard = ({ property }) => {
  const { title, description, image, superHost, beds, guests, rating, price } = property;

  return (
    <div className="card">
      <img src={image} alt={title} />
      {superHost && <span className="badge">Superhost</span>}
      <div className="card-content">
        <h4>{title}</h4>
        <p>{description}</p>
        <div className="info">
          <span><FaBed /> {beds} Bedroom</span>
          <span><FaUserFriends /> {guests} Guest</span>
          <span>‚≠ê {rating}</span>
        </div>
        <strong>${price}/night</strong>
      </div>
    </div>
  );
};

export default PropertyCard;
